    width: 30px;
    height: 30px;
    transition: fill 150ms ease;
}

/* On screens that are less than 700px wide, make the nav into a topbar */
@media screen and (max-width: 700px) {
    .nav {
        width: 100%;
        height: auto;
        position: relative;
    }

    .nav a {
        float: left;
    }

    div.content {
        margin-left: 0;
    }
}

/* On screens that are less than 400px, display the bar vertically, instead of horizontally */
@media screen and (max-width: 400px) {
    .nav a {
        text-align: center;
        float: none;
    }
}
